import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import {Router} from '@reach/router';
import PetList from './views/PetList';
import AddPetForm from './views/AddPetForm';

function App() {
  return (
    <div className="App">
      <h1>Pet Shelter</h1>
      <Router>
        <PetList path="/" />
      </Router>
    </div>
  );
}

export default App;
